import React from 'react';
import './Why.css';

const Why = () => {
  return (
    <div className="Why">
      <div className="why-box">
        <h2>Why Aerial Silks?</h2>
        <p>Aerial silks is a graceful and effective form of exercise that involves performing acrobatic moves while suspended from fabric silks. It is a great way to stay fit and challenge yourself, all while having fun. With regular practice, aerial silks can help develop strength, flexibility, and coordination. It&apos;s a unique combination of physical and mental challenges which can boost confidence and leave you feeling empowered. Why not give aerial silks a try and experience the excitement for yourself?</p>
      </div>
    </div>
  );
};

export default Why;
